import {React} from "react";
import {Link} from "react-router-dom";
import styled from "styled-components";
import Header from "./Header";
import MASHA from "./MASHA.png";
import masha from "./masha .png";
import project1 from "./PORTFOLIO/project1.png";
import project2 from "./PORTFOLIO/project2.png";
import project3 from "./PORTFOLIO/project3.png";
import project4 from "./PORTFOLIO/project4.png";
import project5 from "./PORTFOLIO/project5.png";
import project7 from "./PORTFOLIO/project7.png";
import project8 from "./PORTFOLIO/project8.png";
import project9 from "./PORTFOLIO/project9.png";
import project12 from "./PORTFOLIO/project12.png";
import Torus from "./Torus.png";
import Pasted_Graphic_1 from "./Pasted_Graphic_1.png";






const Home = () => {
    return (
        <PageContainer>
            <Header/>
            <LandingContainer>
                <img src={MASHA} height='100%' alt={'pic'} style={{zIndex: "1"}}></img>
                <img src={masha} height='104%' alt={'pic'} style={{position:'absolute', top: "50px", left: "537px", zIndex: "1"}}></img>
            </LandingContainer>
            <SeparatorContainer>
                <Title>PROJECTS</Title>
            </SeparatorContainer>
            <HomeContainer>
                <img src={project1} height='450px' alt={'pic'} style={{zIndex: "1"}}></img>
                <img src={project5} height='450px' alt={'pic'} style={{zIndex: "1"}}></img>
                <img src={project3} height='450px' alt={'pic'} style={{zIndex: "1"}}></img>
                <img src={project2} height='450px' alt={'pic'} style={{zIndex: "1"}}></img>
                <img src={project8} height='450px' alt={'pic'} style={{zIndex: "1"}}></img>
                <img src={project12} height='450px' alt={'pic'} style={{zIndex: "1"}}></img>
                <img src={project7} height='450px' alt={'pic'} style={{zIndex: "1"}}></img>
                <img src={project4} height='450px' alt={'pic'} style={{zIndex: "1"}}></img>
                <img src={project9} height='450px' alt={'pic'} style={{zIndex: "1"}}></img>
            </HomeContainer>
            <DescriptionContainer>
                <img src={Torus} height='650px' alt={'pic'} style={{zIndex: "1"}}></img>
                <div style={{maxWidth: "530px", gap: "20px", display: 'flex', flexDirection: 'column', textAlign:"start", alignItems:"start", marginTop: "85px"}}>
                    <div style={{fontSize: 80, fontWeight: 400, lineHeight: "68px"}}>SOMETHING ABOUT ME</div>
                    <div style={{fontSize: 25, fontWeight: 400, lineHeight: "32.5px", display: "flex"}}>I'm Masha Sredina, a visual designer with a colorful past.
                        From my artistic roots in Moscow <br/> to my current adventures in Barcelona.
                        From <br/> fine arts to teaching them and now, conquering the design world here in Barcelona.
                          As a Graphic, UI and Branding designer, I'm not just crafting visuals,
                        I'm weaving stories and emotions into every pixel. </div>
                </div>
            </DescriptionContainer>
            <DescriptionContainerPink>
                <div style={{
                    maxWidth: "443px",
                    gap: "20px",
                    display: 'flex',
                    flexDirection: 'column',
                    textAlign: "start",
                    alignItems: "start",
                    marginTop: "85px",
                    marginRight: "85px",
                }}>
                    <div style={{fontSize: 80, fontWeight: 400, lineHeight: "68px"}}>ARFE</div>
                    <div style={{fontSize: 25, fontWeight: 400, lineHeight: "32.5px", display: "flex"}}>
                        ARFÉ is a startup designed to break down the financial barriers
                        that prevent young artists from showcasing their talent.
                    </div>
                </div>
                <img src={Pasted_Graphic_1} height='100%' alt={'pic'} style={{zIndex: "1"}}></img>
            </DescriptionContainerPink>
            <DescriptionContainerPink>

            </DescriptionContainerPink>

        </PageContainer>

    )
}


const PageContainer = styled.div`
    display: flex;
    overflow: hidden;
    width: 100%;
    flex-direction: column;
    justify-content: start;
    align-items: stretch;
    color: #fff;
    background-color: #171819;
    gap: 0;
`;

const LandingContainer = styled.div`
    height: 105vh;
    text-align: start;
    display: flex;
    flex-direction: column;
    overflow: hidden;
    justify-content: center;
    align-items: center;
    color: #fff
`;

const HomeContainer = styled.div`
    height: 100%;
    text-align: start;
    display: grid;
    grid-template-columns: 1fr 1fr 1fr;
    grid-gap: 20px;
    gap: 20px;
    flex-direction: row;
    justify-content: space-between;
    align-items: start;
    padding-left: 90px;
    padding-right: 90px;
    background-color: #171819;
    color: #fff;
    z-index: 0;
`;

const DescriptionContainer = styled.div`
    max-height: 100vh;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: start;
    padding-left: 90px;
    padding-right: 90px;
    padding-top: 105px;
    color: #fff;
    z-index: 0;
`;

const DescriptionContainerPink = styled.div`
    height: 850px;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: start;
    padding-left: 90px;
    padding-right: 90px;
    margin-top: 105px;
    padding-top: 105px;
    color: #171819;
    background-color: #F857A6;
    z-index: 0;
`;

const SeparatorContainer = styled.div`
    overflow: hidden;
    height: 300px;
    text-align: start;
    display: flex;
    flex-direction: row;
    justify-content: start;
    align-items: center;
    padding-left: 85px;
    background-color: #171819;
    color: #fff;
    z-index: 0;
`;

const Title = styled.div`
    font-size: 100px;
    font-weight: 400;
    color: #fff;
    //text-shadow: 1px 1px 5px rgba(0,0,0,1);
    z-index: 1;
`;


const SubTitle = styled.div`
    font-size: 32px;
    font-weight: 200;
    padding: 0px 10px;
    color: #fff;
    text-shadow: 1px 1px 5px rgba(0,0,0,0.5);
    z-index: 1;
`;


const StyledButton = styled.button`
    background-color: #0AD70A;
    color: #0a0a0a;
    //background-color: #fff;
    margin-top: 30px;
    margin-right: 10px;
    font-size: 18px;
    font-weight: 500;
    padding: 20px 40px;
    border: 2px solid #0AD70A;
    //border-radius: 30px;
    //text-shadow: 2px 1px 2px rgba(0,0,0,0.3);
    //box-shadow: 2px 4px 5px rgba(0,0,0,0.7);
    z-index: 1;
    transition: all 0.2s ease-in-out;
    &:hover {
        background-color: #0a0a0a;
        color: #0AD70A;
        border: 2px solid #0AD70A;
        transition: all 0.2s ease-in-out;
    }
`;


const Styledvideo = styled.video`
    position: absolute;
    top: -75px;
    left: -0px;
`;



export default Home;
